indian_tz = pytz.timezone('Asia/Kolkata')

def format_date(date_str):
    try:
        return datetime.strptime(date_str, "%Y-%m-%dT%H:%M:%S.%fZ") \
            .replace(tzinfo=pytz.utc).astimezone(indian_tz) \
            .strftime("%d-%m-%Y %I:%M%p")
    except:
        return date_str

