def png_to_base64(png_file):
    with open(png_file, "rb") as image_file:
        image_data = image_file.read()
        base64_encoded = base64.b64encode(image_data).decode('utf-8')
        return base64_encoded
    


def generate_qr(serial_number):
    url = pyqrcode.create(serial_number)
    url.png('barcode.png', scale = 6)


def generate_qr_base64(serial_number):
    url = pyqrcode.create(serial_number)
    
    with io.BytesIO() as image_bytes:
        url.png(image_bytes, scale=6)
        image_bytes.seek(0) 
        base64_encoded = base64.b64encode(image_bytes.read()).decode('utf-8')
        return base64_encoded